import React,{createContext, useState} from 'react'
import Card from './Card'
import Data from './Data'

const data_pass = createContext()

const List = () => {

const [allcards, setallcards] = useState(Data)

  return (
    <data_pass.Provider value={{allcards:allcards, set_cards:setallcards,}}>
    <div className='list_css'>
        {
        allcards.map(card =>{
          return <Card 
          key={card.id}
          card={card}
          />
        })
      }
       
    </div>
    </data_pass.Provider>
  )
}

export default List
export {data_pass}
